import React from "react";
import "../Styles/TicketManagement.css";

const TicketManagement: React.FC = () => {
    return (
        <div className="ticket-management">
            <header className="home-header">
                <h1>Welcome to Ticket Management</h1>
                <p>Select a category to manage tickets:</p>
            </header>
            <div className="button-container">
                <button className="category-button">Quản lý vé xe bus</button>
                <button className="category-button">Quản lý vé xe khách</button>
                <button className="category-button">Quản lý vé xe du lịch</button>
                <button className="category-button">Quản lý vé xe taxi</button>
                <button className="category-button">Quản lý xe ôm</button>
            </div>
        </div>
    );
};

export default TicketManagement;
